import { React, PureComponent } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


import Content from "./component/content/Content";
import Header from "./component/header/Header";


class App extends PureComponent {
  constructor(props) {
    super(props);
    this.state = {
        product: "all"
    }
}

  render() {

    return (
      <div className="App"> 
              <Router className="router">
              <Header />
                <Routes>
                  <Route path={`product/${this.state.product}`} element= {<Content cat = "all" />} />
                  {/* <Route path={`product/tech`} element= {<Content cat = "tech"/>} />
                  <Route path={`product/clothes`} element= {<Content cat = "clothes" />} /> */}
                </Routes>
            </Router>
      </div>
    );
  }

}

export default App;
